import styled from 'styled-components';
import { ErrorMessage as Base } from '@buffetjs/styles';

const ErrorMessage = styled(Base)`
  padding-top: 11px;
  padding-bottom: 0;
  margin-bottom: 17px;
`;

export default ErrorMessage;
